import React from "react";
import { useParams } from "react-router-dom";
import { useGetProductItemQuery } from "../../redux/productsApi";
import style from "./style.module.css";
impo

export const SkuPage = () => {
  const { id } = useParams();
  const { data, error, isLoading } = useGetProductItemQuery(id);
  const dates = data && data[0];
  return (
    <div>
      {isLoading ? (
        <p>loading...</p>
      ) : error ? (
        <p>Error</p>
      ) : (
        <div>
          <h2>{dates.title}</h2>
          <div >
            <img className={style.img}
              src={`http://localhost:3333${dates.image}`}
              alt={dates.title}
            />
          </div>
          <div>
          <div className={style.priceBox}>
            <p>{dates.price}$</p>
            <p>{dates.discont_price}$</p>
            <p>%</p>
          </div>
          <button>To cart</button>
          <div>
            <h3>Description</h3>
            <p>{dates.description}</p>
          </div>
        </div>
        </div>
      )}
    </div>
  );
};
